      showSettings: false,

      chkAll: true,
      chkPaidTickets: true,
      chkFreeTickets: true,
      chkPaidAddOns: true,
      chkFreeAddOns: true,
      chkBoxOfficeSales: true,
      chkShowRevenue: true,

      http_status_sale: HTTP_INIT,
      http_status_releaseBreakdown: HTTP_INIT,
      http_status_addonBreakdown: HTTP_INIT,
      http_status_rebates: HTTP_INIT,
      http_status_boxOfficeSales: HTTP_INIT,
      http_error_sale: null,
      http_error_releaseBreakdown: null,
      http_error_addonBreakdown: null,
      http_error_rebates: null,
