  componentDidMount(){
    this.unMounted = false    
  }

  componentWillUnmount(){
    this.unMounted = true
  }

  componentDidUpdate(){    
    let loading = this.state.http_status_sale <= HTTP_LOADING || 
      this.state.http_status_releaseBreakdown <= HTTP_LOADING || 
      this.state.http_status_addonBreakdown <= HTTP_LOADING || 
      this.state.http_status_rebates <= HTTP_LOADING || 
      this.state.http_status_boxOfficeSales <= HTTP_LOADING
    if(this.state.isLoading && !loading){
      this.print()
      this.setState({isLoading: false})
    }
  }

  load_sales(){
    const {event} = this.props

    const url = `/api/events/${event.id}/relationships/performance/`
		const param = {'section': 'sales'}
    const node = 'data.sales.*'
    const self = this

		oboe({
			url: makeURL(url, param),
			method: 'GET',
			headers: isDemoAccount() ? null : {
				'Accept': 'application/vnd.api+json',
				'Content-Type': 'application/vnd.api+json'
			},
			withCredentials: true
		}).node(node, (record) => {
			if(!self.unMounted) {
				self.tmp_sale.push(record)
				if(self.tmp_sale.length === CACHE_SIZE){
					self.addToRow(HTTP_TYPE_SALE, self.tmp_sale, HTTP_LOADING, null)
				}
			}
		}).done(() => {
			if(!self.unMounted)
				self.addToRow(HTTP_TYPE_SALE, null, HTTP_LOADING_SUCCESSED, null)
		}).fail((errorReport) => {
			if(!self.unMounted)
				self.addToRow(HTTP_TYPE_SALE, null, HTTP_LOADING_FAILED, errorReport)
		})
  }

